function ProductList(props) {
    return (
      <div className="parent">
        {props.products.map((product) => (
          <Product
            key={product.id}
            name={product.name}
            price={product.price}
            image={product.image}
          />
        ))}
      </div>
    );
  }







export default ProductList;
